'use strict';
//@@DocBrief("The class provides access to account rollover profile information")
class RolloverProfile {
    arpId;
    offerID;
    rolloverBuyMarkup;
    rolloverSellMarkup;
    changeNo;
    constructor() {
        this.arpId = "";
        this.offerID = "";
        this.rolloverSellMarkup = 0.0;
        this.rolloverBuyMarkup = 0.0;
        this.changeNo = 0;
    }
    getARPId() {
        return this.arpId;
    }
    getOfferID() {
        return this.offerID;
    }
    getRolloverBuyMarkup() {
        return this.rolloverBuyMarkup;
    }
    getRolloverSellMarkup() {
        return this.rolloverSellMarkup;
    }
    getChangeNo() {
        return this.changeNo;
    }
}
module.exports = RolloverProfile
